import './App.css';
import React, { useState } from 'react';
import {
  createBrowserRouter,
  RouterProvider,
} from 'react-router-dom';
import LandingPage from './Pages/LandingPage';
import Dashboard from './Pages/Dashboard';
import CreateSpace from './Pages/CreateSpace';
import WorkSpace from './Pages/WorkSpace';
import PublicPage from './Pages/PublicPage';
import LoginPage from './Pages/LoginPage';
import Iframecode from './Pages/Iframecode'


const App = () => {

   const router = createBrowserRouter([
    {
      path: '/',
      element: <LandingPage />,
      children: [],
    },
    {
      path: '/dashboard',
      element: <Dashboard />,
      children: [],
    },
    {
      path: '/createspace',
      element: <CreateSpace />,
      children: [],
    },
    {
      path: '/workspace/:id',
      element: <WorkSpace />,
      children: [],
    },
    {
      path: '/publicpage/:workspaceid',
      element: <PublicPage />,
      children: [],
    },
    {
      path: '/login',
      element: <LoginPage />,
      children: [],
    },
    {
      path: '/frame',
      element: <Iframecode/>,
      children: [],
    },
  ]);

  return <RouterProvider router={router} />;
};

export default App;
